import { Layout, Row, Button, Table, Typography } from 'antd'
import './PayPage.css'
import { DownloadOutlined, EyeOutlined } from '@ant-design/icons'

import Navbar from '../../Navbar/Navbar'

export const PayPage = () => {
  const { Content, Footer } = Layout

  const { Title } = Typography

  const dataSource = [
    {
      key: '1',
      refer: '2021OCT_HCI',
      year: '2021',
      month: 'October',
      from: '01-10-2021',
      to: '31-10-2021'
    },
    {
      key: '2',
      refer: '2021SEPT_HCI',
      year: '2021',
      month: 'September',
      from: '01-09-2021',
      to: '30-09-2021'
    },
    {
      key: '3',
      refer: '2021AUG_HCI',
      year: '2021',
      month: 'August',
      from: '01-08-2021',
      to: '31-08-2021'
    },
