      year: '2021',
      month: 'July',
      from: '01-07-2021',
      to: '31-07-2021'
    },
    {
      key: '4',
      refer: '2021JULY_HCI',
      year: '2021',
      month: 'July',
      from: '01-07-2021',
      to: '31-07-2021'
    }
  ]

  const columns = [
    {
      title: 'PaySlip Reference',
      dataIndex: 'refer',
      key: 'refer'
    },
    {
      title: 'Year',
      dataIndex: 'year',
      key: 'year'
    },
    {
      title: 'Month',
      dataIndex: 'month',
      key: 'month'
    },
    {
      title: 'Date From',
      dataIndex: 'from',
      key: 'from'
    },
    {
      title: 'Date To',
      dataIndex: 'to',
      key: 'to'
    },
    {
      title: 'Action',
      dataIndex: '',
      key: 'x',
      render: () => <Button icon={<EyeOutlined />}></Button>
    }
  ]

  return (
    <Layout>
      <Navbar name="payslip"/>
      <Content className='layout'>
        <Row>
          <Title>My Payslips</Title>
          <Button icon={<DownloadOutlined />} className='button'></Button>
        </Row>

        <Table
          rowSelection
          dataSource={dataSource}
          columns={columns}
          pagination={false}
          scroll={{ y: 350 }}
        />
      </Content>
      <Footer style={{ textAlign: 'center' }}>Team 08</Footer>
    </Layout>
  )
}

export default PayPage
